import React from 'react';
import "./index.css"
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";


const Karack = () => {
    return (

        <>
            <div style={{ backgroundColor: 'royalblue', width: '100vw', height: '100vh' }} class='text-center mt-5 full-width cover-full width w-500 h-1000'>
                <a  href="/kahome">

                    <img width='700px' src="/images/Ka_Stability_Rack.png" alt="" />

                </a>

            </div>

        </>

    );
}


export default Karack;
